import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import "./style.css";
class InputSearchItem extends React.Component {
    render() {
        return (
            <>
                {/* <li className="listItems">
                    <a href="123" className="item-link">
                        <FontAwesomeIcon className="icon" icon={this.props.item.icon}/>
                        <span className="text">{this.props.item.text}</span>
                    </a>
                </li> */}
                <ul>
                   {
                      this.props.item.map((item,index)=>(
                          <li key={index}>
                            <a href="123" className="item-link">
                                <FontAwesomeIcon className="icon" icon={item.icon}/>
                                <span className="text">{item.text}</span>
                            </a>
                          </li>
                      ))
                   }
               </ul>

            </>
        );
    }
}

export default InputSearchItem;
